import { useEffect } from "react";
import { useDispatch } from "react-redux";
import { getPokemonsbdd, getPokemonsapi } from "../../redux/actions";
import axios from "axios";


const Home = () => {
    const dispatch = useDispatch();

    useEffect(() => {
        const pokemons = [];

        pokemons.push(axios.get`http://localhost/pokemonapi/get`)

        dispatch(getPokemonsapi())
    }, [])

    return (
        <>
            <hr></hr>
            <h1> HOME </h1>
            <h4>pokemones:</h4>
            <CardsCont />
            <button>pag siguiente</button>
            <hr></hr>
        </>
    )
}

export default Home;
